// Cartas - index.js

import React from 'react';

const Cartas = ({ numero, palo, bocaAbajo }) => {
  const imagen = bocaAbajo ? './Imagenes/back.png' : `./Imagenes/${palo}/${numero}.png`;

  return (
    <div className="carta">
      <img src={imagen} alt={`Carta ${numero} de ${palo}`} style={{ width: '110px' }} />
    </div>
  );
};

export default Cartas;
